const Custos = ({ notas }) => {
  let nNotas = [];
  for (let i = 0; i < notas.lenght; i++) {
    nNotas.push(notas[i]);
  }

  return <div>{nNotas.map((nota) => nota.corretora)}</div>;
};

export default Custos;
